/**
 * Navigates to a given page.
 * This helper yields the pagination element.
 *
 * @example
 * ```ts
 *    cy.get('[data-testid="myPaginationComponent]')
 *      .then(goToPage(2))
 * ```
 */
export var goToPage = function (pageNumber) { return function ($element) {
    cy.wrap($element).contains(pageNumber).click();
    return cy.wrap($element);
}; };
/**
 * Navigates to the next page.
 * This helper yields the pagination element.
 *
 * @example
 * ```ts
 *    cy.get('[data-testid="myPaginationComponent]')
 *      .then(nextPage)
 * ```
 */
export var nextPage = function ($element) {
    cy.wrap($element).get("[aria-label='Next Page']").click();
    return cy.wrap($element);
};
/**
 * Navigates to the previous page.
 * This helper yields the pagination element.
 *
 * @example
 * ```ts
 *    cy.get('[data-testid="myPaginationComponent]')
 *      .then(previousPage)
 * ```
 */
export var previousPage = function ($element) {
    cy.wrap($element).get("[aria-label='Previous Page']").click();
    return cy.wrap($element);
};
/**
 * Yields the currently selected page.
 *
 * @example
 * ```ts
 *    cy.get('[data-testid="myPaginationComponent]')
 *      .then(currentPage)
 * ```
 */
export var getCurrentPage = function ($element) {
    return cy.wrap($element).get("[aria-current='true']");
};
